import React from 'react';

class Navigation extends React.Component {
    render(){
        return <div className="Navigation"> 
                <div className="Logo">
                    Placeholder
                </div>
                <div className="Tabs">
                    Test
                </div>
                    <h1 className="heading">Hello, {this.props.name}</h1>
                </div>
                ;
    }
}
export default Navigation;
